import React from 'react';
import { Link } from 'react-router-dom';

const SubjectList = ({ subjects, onDelete }) => {
  return (
    <div>
      <h2>Subjects</h2>
      <ul>
        {subjects.map(subject => (
          <li key={subject._id}>
            {subject.name} ({subject.code}) - {subject.credits} credits
            
            <Link to={`/subjects/edit/${subject._id}`}>
              <button>Edit</button>
            </Link>

            <button onClick={() => onDelete(subject._id)}>Delete</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default SubjectList;
